import React from "react";
import { useSelector } from "react-redux";

const WeatherInfo = () => {
  const data = useSelector((state) => state.weatherData.weatherDetailedData);
  // console.log(data);

  if (JSON.stringify(data) === "{}") {
    return <div>No result</div>;
  }
  return (
    <div>
      <h1>{data.name}</h1>
      <p>Overall Temperature: {data.main.temp}</p>
      <p>Maximum Temperature: {data.main.temp_max}</p>
      <p>Minimum Temperature: {data.main.temp_min}</p>
      <p>Pressure: {data.main.pressure}</p>
      {/* <p>Weather Description: {data.weather[0].description}</p> */}
      {/* <p>Main Weather: {data.weather[0].main}</p> */}
      <p>Wind Speed: {data.wind.speed}</p>
    </div>
  );
};

export default WeatherInfo;
